import styles from './FooterStyles.module.css';

function Footer() {
  return (
    <section id="footer" className={styles.container}>
      <p>
        &copy; Jayesh Kushwaha. <br />
        All rights reserved.
      </p>
    </section>
  );
}

export default Footer;
